import pytest
from firebird.qa import db_factory, isql_act, Action

# version: 3.0
# resources: None

substitutions_1 = [('^((?!sqltype|literal).)*$', ''), ('[ ]+', ' '), ('[\t]*', ' ')]

init_script_1 = """"""

db_1 = db_factory(page_size=4096, sql_dialect=3, init=init_script_1)

test_script_1 = """
    set sqlda_display on;
    set planonly;

    select
    '#abcdefghjklmnopqrstu012345'
    from rdb$database;

    select
    '#abcdefghjklmnopqrstu0123456'
    from rdb$database;

    select
    '#abcdefghjklmnopqrstu01234567'
    from rdb$database;
  """

act_1 = isql_act('db_1', test_script_1, substitutions=substitutions_1)

expected_stdout_1 = """
    01: sqltype: 452 TEXT scale: 0 subtype: 0 len: 32765 charset: 0 NONE
    01: sqltype: 452 TEXT scale: 0 subtype: 0 len: 32766 charset: 0 NONE
    01: sqltype: 452 TEXT scale: 0 subtype: 0 len: 32767 charset: 0 NONE
  """

@pytest.mark.version('>=3.0')
def test_1(act_1: Action):
    act_1.expected_stdout = expected_stdout_1
    act_1.execute()
    assert act_1.clean_expected_stdout == act_1.clean_stdout

